import MoviesCard from "../MoviesCard/MoviesCard";
import one from '../../../images/1'

function MoviesCardList() {
    return(
        <section className='cardlist'>
            <MoviesCard
            title='Девять'
            time='1ч 20м'
            img={one} />
        </section>
    )
}

export default MoviesCardList;
